# ddddocr识别缺口
det = ddddocr.DdddOcr(det=False, ocr=False)

with open('qk.png', 'rb') as f:
    target_bytes = f.read()

with open('bg.png', 'rb') as f:
    background_bytes = f.read()

res = det.slide_match(target_bytes, background_bytes)

print(res)
